        { user_id: '112', firstname: 'Baran', lastname: 'Longan', email: 'ZeryaBetül@gmail.com' },
      ];
   


   


 
    return (
        <div style={{marginTop:100}}>
            <Row>
    <Col sm={2}>
        <SideNavBar active={'users'} />
    </Col>
    <Col sm={10}>
        <Row>
            <div style={{padding: 10 , color:'#30408D'}}>
                <h1>Users</h1>
            </div>
        </Row>

        <Row>
